import React from "react";

import Sdata from "../Sdta";
import Collectioncard from "./Collectioncard";

const Listpunk = () => {
  return (
    <>
      {Sdata.map((val) => {
        return (
          <div onClick={() => console.log(1)}>
            <Collectioncard
              pic={val.imgSrc}
              id={val.id}
              name={val.title}
              rate={val.price}
              imgs={val.img2}
            />
          </div>
        );
      })}
    </>
  );
};

export default Listpunk;
